import React, { useState, useEffect } from "react";
import css from "@emotion/css";

const LeftInfo = ({ isProfileData }) => {
  const [dataProfile, setDataProfile] = useState([]);
  //const leftProfileData = isProfileData.profile[0];
  useEffect(() => {
    setDataProfile(isProfileData.profile[0]);
  }, []);
  return (
    <React.Fragment>
      <div className="block">
        <p
          className="text-sm font-sans"
          css={css`
          & > span{
            float:left;
            width:50%:
            display:block;
          }
        `}
        >
          <span>Name</span>:{dataProfile.firstName}
        </p>
      </div>
    </React.Fragment>
  );
};

export default LeftInfo;
